import React from "react";
import { Link } from "react-router-dom";

const NavBar = () => {
  return (
    <React.Fragment>
      <header style={{ border: "1px solid black" }}>
        <div>
          Weather
          <br />
          App
        </div>
        <nav>
          <Link to="/">Home</Link>
          <Link to="/favourite-places">Favourite places</Link>
          <Link to="/help">Help</Link>
        </nav>
      </header>
    </React.Fragment>
  );
};

export default NavBar;
